export const Formularios = () => {

    use
  return (
    <>
        <h3>Formularios</h3>
        <input type="email" name="" id="" className="form-control" placeholder='Email'/>
        <input type="text" name="" id="" className="form-control mt-2 mb-2" placeholder='Password'/>
        
    </>
  )
}
